def add_EQforpress(note, Q=0.4, gain=-30):
    gainEQ = gain
    sos = EQ.peak_filter_iir(2500, gain=gainEQ, Q=Q, fs=44100)  # gain负值，就是陷波滤波器
    note = scipy.signal.sosfilt(sos, note)

    return note




def decay(data_raw):
    data_len = 3200# len(data_raw)


    decay_x = np.linspace(0, 3.5, data_len)
    mean = -2
    standard_devation = 0.5
    norm = stats.norm(mean, standard_devation)
    decay_y  = norm.pdf(decay_x) / norm.pdf(0)
    data = data_raw
    data[-data_len:] = data[-data_len:] * decay_y

    # data_raw = data
    return data_raw

